sis and team management for client delivery work for overseas projects."', NULL, NULL, NULL, NULL, NULL, '1603129487536Screenshot from 2020-10-19 23-00-08.png', '2020-10-19 22:51:52', '2020-10-19 22:51:52', NULL, NULL, NULL, '1107PB147', 3, 2, 1, 2, 1, 1, 1, 0, 7, 0, 1, 0, NULL, 1, 1, 0),
